import {GoogleMap, withGoogleMap, withScriptjs} from "react-google-maps";


 function Map(){
  return <GoogleMap defaultZoom={10} defaultCenter={{lat:50.827847, lng:12.921370}}/>
}

const WarappedMap = withScriptjs(withGoogleMap(Map))

function App() {
